# modules for mathematical tasks
import cmath 
import math
from sympy import *
 
# Functions I created/defined to solve a specific problem 
# a function for multiplying 2 complex numbers in polar form  
def p_multiplication2(c,d): 
  resultant_r = c[0] * d[0]
  resultant_angle = c[1] + d[1]
  resultant_pol = int(resultant_r), int(resultant_angle)
  return resultant_pol
 
# a function for multiplying 3 complex numbers in polar form  
def p_multiplication3(e,f,g):
  resultant_r = e[0] * f[0] * g[0]
  resultant_angle = e[1] + f[1] + g[1]
  resultant_pol = int(resultant_r), int(resultant_angle)
  return resultant_pol
 
# a function for dividing 2 complex numbers in polar form  
def p_division2(h,i):
  resultant_r = h[0] / i[0]
  resultant_angle = h[1] - i[1]
  resultant_pol = int(resultant_r), int(resultant_angle)
  return resultant_pol
 
# a function that takes in r and angle to convert polar to rectangular
def r_form(a,b):
  r = a
  rad_angle = math.radians(b)
  cos_angle = math.cos(rad_angle)
  sin_angle = math.sin(rad_angle)
  x = round(r*cos_angle, 2)
  y = round(r*sin_angle, 2)
  rectangular_form = complex(x,y)
  return rectangular_form
 
''' a function that takes in a complex number and returns a tuple data type 
 consisting the magnitude r and angle θ, it also prints the value of
 r and θ  '''
def p_form(cnum):
  r = abs(cnum)
  rad = cmath.phase(cnum)
  deg = math.degrees(rad)
  resultant_pol = int(r), int(deg)
  print("r = %.1f , θ = %.2f°"%(r , deg))
  return resultant_pol
 
# a function that takes in a tuple and prints its elements as a polar form 
def pform_str(z):
  output = "polar form: " + str(z[0]) + "∠" + str(z[1]) + "°" 
  print(output)
 
# a function for calculating the current
def current_I(j,k):
  i = j*k
  return i
 
# a function for calculating the total impedance 
def Z_total(l,m,n):
  z = (1/l)**-1 + (1/m)**-1 + (1/n)**-1
  return z
 
# a function for calculating the admittance
def admittance(o):
  y = 1/o
  return y
 
# a function for calculating the total admittance
def Y_total(p,q,r):
  y = p + q + r
  return y

